const express = require("express");
const app = express();


const data = [
    {
      "body": "deepak",
      "amount": "1123",
      "id": 1
    },
    {
      "body": "goyal",
      "amount": "543",
      "id": 2
    },
    {
      "body": "ine",
      "amount": 0,
      "id": 3
    },
    {
      "body": "r",
      "amount": 0,
      "id": 7
    },
    {
      "body": "r",
      "amount": 0,
      "id": 8
    }
]

app.get("/transactions", (req, res) => {
    res.send(data);
});

const PORT = process.env.PORT || 8080;

app.listen(PORT, console.log(`Server started on port ${PORT}`));
